contract Maps {
    //mapping(uint256 => mapping(address => string)) public ;
    mapping(uint256 => mapping(address => string)) tokenUri;
    mapping(uint256 => address) public tokenOwner;
    mapping(uint256 => bool) public inSale;
    mapping(uint256 => uint) public price;

    uint256[] public catalogue;
    uint256 tokenCounter;

    constructor() public {
        tokenCounter = 1;
    }

    function setUris(string memory _uri) public {
        tokenUri[tokenCounter][msg.sender] = _uri;
        tokenOwner[tokenCounter] = msg.sender; 
        inSale[tokenCounter] = false;
        tokenCounter++;
    }

    function setForSale(uint256 tokenId, uint _price) public {
        require(tokenOwner[tokenId] == msg.sender, "You have to own the token in order to set it for sale.");
        require(inSale[tokenId] == false, "The token id must have not been in sale before.");

        inSale[tokenId] = true;
        price[tokenId] = _price;
        catalogue.push(tokenId);
    }

    function getCatalogue() public view returns (uint256[] memory) {
        return catalogue;
    }

    function buyNFT(uint256 tokenId) payable public returns (uint256) {
        require(msg.value >= price[tokenId], "Not enought Ether provided.");
        uint256 cat_len = catalogue.length;
        for (uint i = 0; i < cat_len; i++) {
            if (catalogue[i] == tokenId)
            {
                tokenOwner[tokenId] = msg.sender;
                inSale[tokenId] == false;
            }
        }
    }
}
